jQuery.sap.declare("formatter");formatter={formatDate:function(t){if(t&&t!=="00000000"){return sap.ui.core.format.DateFormat.getDateInstance({pattern:"MMM dd, yyyy"}).format(new Date(t.substring(4,6)+"/"+t.substring(6,8)+"/"+t.substring(0,4)))}else{return""}},visibleFieldsDom:function(t){if(t==="DM"){return true}return false},visibleFieldsInt:function(t){if(t==="IP"){return true}return false}};